import "./topbar.css"

function isUser(user) {
    if (user && user.username) return user.username;
    return "";
  }

const TopBar = (props) => {
    return (
      <div className="navbar">
        
        {isUser(props.user)}
      </div>
    );
  };

export default TopBar;
